void main() {
  runApp(MyApp());
}

class StockData {
  final DateTime date;
  final double open, high, low, close;
  final double volume;

  StockData(
      {required this.date,
      required this.open,
      required this.high,
      required this.low,
      required this.close,
      required this.volume});
}

class Stock {
  String? s;
  List<DateTime>? t;
  List<double>? o;
  List<double>? h;
  List<double>? l;
  List<double>? v;

  List<double>? c;

  Stock({this.s, this.t, this.o, this.h, this.l, this.c, this.v});

  Stock.fromJson(Map<String, dynamic> json) {
    s = json['s'];
    // t = json['t'].cast<DateTime>();
    // t = (json['t'] as List<dynamic>)
    //     .map((value) => DateTime.parse(value))
    //     .toList();

    o = json['o'].cast<double>();
    h = json['h'].cast<double>();
    l = json['l'].cast<double>();
    c = json['c'].cast<double>();
    v = json['v'].cast<double>();

    t = (json['t'] as List<dynamic>)
        .map((timestamp) =>
            DateTime.fromMillisecondsSinceEpoch(timestamp * 1000))
        .toList();
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = new Map<String, dynamic>();
    data['s'] = this.s;

    data['o'] = this.o;
    data['h'] = this.h;
    data['l'] = this.l;
    data['c'] = this.c;
    data['t'] = this.t;
    data['v'] = this.v;
    return data;
  }
}

class MyApp extends StatelessWidget {
  const MyApp({super.key});

  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      debugShowCheckedModeBanner: false,
      title: 'Stock Chart Example',
      theme: ThemeData(primarySwatch: Colors.blue),
      home: StockChartScreen(),
    );
  }
}

