                    dataSource: stockData,
                    xValueMapper: (StockData data, _) => data.date,
                    yValueMapper: (StockData data, _) => data.volume,
                    pointColorMapper: (StockData data, _) =>
                        VolumeColor(data.open, data.close),
                  )
                ],
              ),
            ),
          ],
        ),
      ),
    );
  }
}

Future<Stock> fetchStocks() async {
  final response = await http.get(
      Uri.parse('https://dev.nepsetrends.com/api/chart/history/1?stock=NABIL'));

  if (response.statusCode == 200) {
    try {
      print('Success');
      print('Response body: ${response.body}');

      // Parse JSON and create Stock object
      return Stock.fromJson(jsonDecode(response.body) as Map<String, dynamic>);
    } catch (e) {
      throw Exception('Failed to parse JSON: $e');
    }
  } else {
    // If the server did not return a 200 OK response, log the error body
    print('Failed to load stock data. Status code: ${response.statusCode}');
    print('Response body: ${response.body}');
    throw Exception('Failed to load stock data');
  }
}

Color? VolumeColor(double open, double close) {
  if (open > close) {
    return Colors.green; // Color for decreasing volume
  } else {
    return Colors.red; // Color for increasing volume
  }
}


